		try {
			const response = await fetch(URL + "get");
			const data = await response.json();
			setServers(data);
		} catch (err) { console.error(err.message); }
	}

	useEffect(() => {
		getServers();
	});

	return (
		<Fragment>
			<table className="table mt-5 text-center">
				<thead>
					<tr>
						<th>Name</th>
						<th>IP</th>
						<th>Time Running</th>
						<th>Type</th>
						<th>Price So Far</th>

						<th>Edit</th>
						<th>delete</th>
					</tr>
				</thead>
				<tbody>

				</tbody>
			</table>
		</Fragment>
	);
}

export default ListServers;
